import { DispatchType, State } from "types/types";


export function reducer(state: State, action: DispatchType) {
    switch (action.type) {
        case 'resetModal':
            state.isOpenModal = action.payload.isOpenModal;
            return {
            ...state,
            };
        case 'resetLoading':
            state.loading = action.payload.loading;
            return {
            ...state,
            };
        default:
            return state;

    }
}
